import styled from 'styled-components';

export const StyledCard = styled.div`
    display: block;
    background-color: #fff;
    margin-top: 8px;
    padding: 5px;
`;

export const StyledBtn = styled.button`
    margin: 0 8px;
    cursor: pointer;
`;
